import React from 'react';
import './CSS/Etlap.css';

import {Termekek} from '../../Termekek';
import  Termek  from '../Oldalak/Termek';  

const Etlap = () => {
  
  return (
    <div className='Etlap'>
     
     
        <div className='etel-title'>
         <h>Étlap</h> Étlap
        </div>

        <div className='termekek'>
        
        {Termekek.map((termek) => <Termek key={termek.id} data={termek}/>)}
        </div>
      
      
    </div>
  );
};

export default Etlap;
